data.text:
@JillianOhana @DanteAtkins And let's be clear here, I'm not just throwing shade for the hell of it. This election HAD to be emphatic. Every one of us said so going in. And this ain't that.

Now the country is in greater danger.

It's time for accountability, and if that hurts feelings then too damn bad.

@PicorisHeir True. Anyone who hung around Vaati long enough gained a more haughty view on life and those around them.

“I’m honored you would.”

The shade gives a small bow- perhaps with a bit of a ‘mocking’ air to it.
